-- Estrutura da tabela `triagem`
--

CREATE TABLE IF NOT EXISTS `triagem` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `peso` int(11) NOT NULL,
  `apgar_1` int(11) NOT NULL,
  `apgar_5` int(11) NOT NULL,
  `apgar_10` int(11) DEFAULT NULL,
  `apgar_15` int(11) DEFAULT NULL,
  `idade_semanas` int(11) NOT NULL,
  `idade_dias` int(11) NOT NULL,
  `metodo_avaliacao` enum('capurro','new_ballard','ecografia','amenorréia') NOT NULL,
  `avaliacao_score` int(11) DEFAULT NULL,
  `termo` enum('termo','pre_termo') NOT NULL,
  `crescimento` enum('aig','pig','gig') NOT NULL,
  `tipo_exame` enum('peate-a','eoat','eoa-pd') NOT NULL,
  `resultado_esquerdo` enum('passou','falhou') NOT NULL,
  `resultado_direito` enum('passou','falhou') NOT NULL,
  `falhou_35` enum('true','false') NOT NULL,
  `falhou_40` enum('true','false') NOT NULL,
  `falhou_45` enum('true','false') NOT NULL,
  `historia_perda_auditiva` enum('true','false') NOT NULL,
  `consanguinidade` enum('true','false') NOT NULL,
  `peso_inferiro_1500` enum('true','false') NOT NULL,
  `pig` enum('true','false') NOT NULL,
  `nascimento_pre_termo` enum('true','false') NOT NULL,
  `apgar_04_primeiro_minuto` enum('true','false') NOT NULL,
  `apgar_06_quinto_minuto` enum('true','false') NOT NULL,
  `uti_5_dias` enum('true','false') NOT NULL,
  `ventilacao_mecanica` enum('true','false') NOT NULL,
  `drogas_ototoxicas` enum('true','false') NOT NULL,
  `hiperbilirrubinemia` enum('true','false') NOT NULL,
  `anomalias_cranio_faciais` enum('true','false') NOT NULL,
  `anoxia_perinatal_grave` enum('true','false') NOT NULL,
  `asfixia_neonatal` enum('true','false') NOT NULL,
  `infeccoes_congenitas_toxoplasmose` enum('true','false') NOT NULL,
  `infeccoes_congenitas_rubeola` enum('true','false') NOT NULL,
  `infeccoes_congenitas_citomegalovirus` enum('true','false') NOT NULL,
  `infeccoes_congenitas_herpes` enum('true','false') NOT NULL,
  `infeccoes_congenitas_sifilis` enum('true','false') NOT NULL,
  `infeccoes_congenitas_hiv` enum('true','false') NOT NULL,
  `infeccoes_congenitas_outra` varchar(250) NOT NULL,
  `sindrome_genetica_deficiencia_auditiva` varchar(250) NOT NULL,
  `infeccoes_bacterianas_virais_citomegalovirus` enum('true','false') NOT NULL,
  `infeccoes_bacterianas_virais_herpes` enum('true','false') NOT NULL,
  `infeccoes_bacterianas_virais_sarampo` enum('true','false') NOT NULL,
  `infeccoes_bacterianas_virais_varicela` enum('true','false') NOT NULL,
  `infeccoes_bacterianas_virais_meningite` enum('true','false') NOT NULL,
  `infeccoes_bacterianas_virais_outra` varchar(250) NOT NULL,
  `traumatismo_craniano` enum('true','false') NOT NULL,
  `quimioterapia` enum('true','false') NOT NULL,
  `materno_drogas_ilicitas` enum('true','false') NOT NULL,
  `disturbios_neurodegenerativos` enum('true','false') NOT NULL,
  `last_update` datetime NOT NULL,
  `paciente_r` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `paciente_r` (`paciente_r`)
) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=55 ;

